import { AxiosResponse } from "axios";
import AssociationRegistrationInfo from "../models/associationRegistration.model";
import getHostName from "./host.service";
import api from "./api.service";
import CitizenRegistrationInfo from "../models/citizenRegistration.model";

async function register(info: AssociationRegistrationInfo): Promise<AxiosResponse> {
    let url = getHostName("/auth/register-association");

    return api.post(url, info, {
        headers: { 'Content-Type': 'application/json'}
    });
}

async function registerCitizen(info: CitizenRegistrationInfo): Promise<AxiosResponse> {
    let url = getHostName("/auth/register-citizen");

    return api.post(url, info, {
        headers: { 'Content-Type': 'application/json'}
    });
}

const obj = {register: register, registerCitizen }
export default obj;
